// CLICKING ON ANY DICE BEGINS THE GAME
// THIS SECTION DEALS WITH THE DICE
$(".dice").click( function() {
	if ($("#variables").data("hasdicebeenrolled")==0) {
		$("#diceRollSnd")[0].play();
		// REMOVE POPUP IF ITS STILL VISIBLE
		if ($("#popup").css("display")!="none") {
			$("#popup").fadeOut(0);
		}
		$(".message").css({ "text-align": "center", "font-size": "36px" });
		$("#variables").data("hasdicebeenrolled", "1"); console.log("Rolling Dice");
		rollDice();
	}		
})
// END OF DICE LOGIC
// /////////////////



// THESE ARE ONLY CLICKABLE ONCE THE DICE HAVE ROLLED
// THIS SECTION DEALS WITH THE PLAYER COUNTERS WHEN MOVEABLE
$(".counterA, .counterB").mouseenter( function() {
	if ($("#" + this.id).hasClass("clickable")) {
		moveposition 	= $("#" + this.id).data("moveposition");
		if ($("." + moveposition).css("opacity")==1) {
			$("." + moveposition).fadeTo(166, 0.2, function() { // FLASH THE MOVEPOSITION SQUARE
				$("." + moveposition).fadeTo(167, 1.0);
			});
		}
	}
});

$(".counterA, .counterB").click( function() {
	if ($("#" + this.id).hasClass("clickable")) { // THIS COUNTER IS READY TO BE CLICKED
		currentposition = $("#" + this.id).data("currentposition");
		if (currentposition=="HMA") { startposition = "EA1"; }
		if (currentposition=="HMB") { startposition = "EB1"; }
		$("." + currentposition).data("taken", 0);
		moveposition 	= $("#" + this.id).data("moveposition");
		taking 			= $("#" + this.id).data("taking");
		$("#" + this.id).css("z-index", 5);
		console.log("MP: " + moveposition + ", T: " + taking);
		// MIGHT AS WELL RESET ALL THE COUNTER VARS BEFORE WE MOVE THE COUNTER AS WE HAVE EVERYTHING WE NEED
		currentPlayer = $("#variables").data("currentplayer");
		if (currentPlayer == 1) {
			counterSetName = "counterA"; opponentCounterSetName = "counterB"; currentpositionlist = $("#variables").data("playeronesquares");
		} else {
			counterSetName = "counterB"; opponentCounterSetName = "counterA"; currentpositionlist = $("#variables").data("playertwosquares");
		}
		$("." + counterSetName).data({ "moveposition": 0, "taking": 0 })
		$("." + counterSetName).removeClass("clickable");
		$("." + counterSetName).css("opacity", 1);
		
		// GET X AND Y COORDS OF WHERE THE COUNTER IS MOVING TO
		coord = $("." + moveposition).position();
		console.log("x: " + coord.left + ", y: " + coord.top);
		$("#" + this.id).css("position", "absolute");
		playerName = counterSetName.substr(7,1);
		
		
		timeout = 0; // THIS TIMOUT IS ADDED TO DEPENDING ON THE ANIMATION PATH
		
		// IS THE CURRENT COUNTER STILL IN THE HOME POSITION?
		if (currentposition=="HMA" || currentposition=="HMB") {
			startCoord = $("." + startposition).position();
			$("#" + this.id).fadeOut(200).css({ top: (startCoord.top + 45), left: (startCoord.left + 45) }).fadeIn(200)
			timeout += 400;
		}
		
		
		pathlist = findPath(currentPlayer, currentposition, moveposition);
		console.log(pathlist);
		pathListArray = pathlist.split(",");
		pathLen = pathListArray.length;
		
		pathXYArray = {};
		if (pathLen!=0) {
			if (pathLen==3 || pathLen==2) {
				// find cooredinates of moves
				for (pathNum = 0; pathNum < pathLen; pathNum++) {
					movingTo = pathListArray[pathNum];
					coords = $("." + movingTo).position()
					pathXYArray[pathNum] = { "x": coords.left,"y": coords.top };
				}
			}
			
			xyoffset = 45;
			if (pathLen==3) {
				localTimeout = 1000;
				pos1xy = pathXYArray[0]; pos2xy = pathXYArray[1]; pos3xy = pathXYArray[2];
				$("#" + this.id).animate({ top: (pos1xy.y + xyoffset), left: (pos1xy.x + xyoffset) }, 333).animate({ top: (pos2xy.y + xyoffset), left: (pos2xy.x + xyoffset) }, 333).animate({ top: (pos3xy.y + xyoffset), left: (pos3xy.x + xyoffset) }, 333);
			}
			if (pathLen==2) {
				localTimeout = 1000;
				pos1xy = pathXYArray[0]; pos2xy = pathXYArray[1];
				$("#" + this.id).animate({ top: (pos1xy.y + xyoffset), left: (pos1xy.x + xyoffset) }, 333).animate({ top: (pos2xy.y + xyoffset), left: (pos2xy.x + xyoffset) }, 333)
			}
			if (pathLen==1) {
				localTimeout = 1000;
				$("#" + this.id).animate({ top: (coord.top + xyoffset), left: (coord.left + xyoffset) }, localTimeout)
			}
			
			timeout +=localTimeout ;
		}
		
		idname = this.id;
		setTimeout( function() {
			completeMove(idname, moveposition, currentPlayer, taking);
		}, timeout);
		
	}
});
// END OF PLAYER COUNTER LOGIC
// ///////////////////////////


$("#popup").click( function() {
	if ($("#popup").css("display")!="none") {
		$("#popup").fadeOut(1000, function() {
			console.log("popup fade out has finished")
		})
	}
});

function completeMove(idname, moveposition, currentPlayer, taking) {
	
	wincounter = 0; // WE'LL BE CHECKING FOR A WIN STATE A LITTLE LATER ON IN THIS FUNCTION
	if (currentPlayer == 1) { counterSet = "counterA"; opponentCounterSetName = "counterB"; endsquare = "FNA"; } else { counterSet = "counterB"; opponentCounterSetName = "counterA"; endsquare = "FNB"; }
	
	if (moveposition != "FNA" && moveposition != "FNB") { // IGNORE COUNTERS THAT HAVE COMPLETED THE RUN
		$("#" + idname).data("currentposition", moveposition);
		$("#" + idname).data(      "taken", playerName);
		$("." + moveposition).data( "taken", playerName);
		console.log("Taken has been set to " + playerName);
		
		if (taking==1) {
			// FIND THE COUNTER CURRENTLY OCCUPYING THE SPACE
			$("." + opponentCounterSetName).each( function() {
			currentpositiondata = $("#" + this.id).data();
				currentposition = currentpositiondata.currentposition;
				if (currentposition == moveposition) {
					console.log("FOUND THE COUNTER --- RETURNING IT BACK TO BASE");
					position = $("#" + this.id).position(); // x and y coords
					$("#" + this.id).fadeOut(500, function() {
						// RESET THE COUNTERS POSITION
						$("#" + this.id).css({ "position": "", "left": "", "top": "" });
						// 	RESET ITS VARIABLES
						player = opponentCounterSetName.substr(7,1);
						$("#" + this.id).data({ "currentposition": "HM" + player, "moveposition": 0, "taking": 0, "taken": 0 })
						$("#" + this.id).fadeIn(500);
					});
				}
			});
		}
		
		// NEXT: CHECK IF PLAYER HAS LANDED ON A FREE SHOT SQUARE
		freeShot="SA4,SB4,AT4,HA2,HB2";
		if (freeShot.includes(moveposition)) {
			// CURRENT PLAYER GETS ANOTHER SHOT
			popup("Free Shot", "Throw the dice again player " + currentPlayer, 0);
			$("#variables").data("hasdicebeenrolled", 0);
		} else {
			// NEXT PLAYERS SHOT
			nextPlayersShot(currentPlayer);
		}
		
	} else {
		// WE HAVE A FINISH MOVE - FADE OUT COUNTER AND SET TO IMMOVABLE
		// NOTE: WE CANT JUST REMOVE IT FROM THE DOM AS ID HAVE TO TEST IF THE COUNTER
		// IS AVAILABLE OR NOT IN SEVERAL DIFFERENT PLACES - THIS IS EASIER
		$("#" + idname).fadeOut(1000);
		$("#" + idname).data({ "currentposition": moveposition });
		
		// CHECK FOR WIN STATE
		changed=false;
		$("." + counterSet).each( function() {
			if ($("#" + this.id).data("currentposition") == endsquare) { wincounter++; }
		});
		
		if (wincounter==7) { // WE HAVE A WINNER!
			popup("WINNER", "Well done player " + currentPlayer + ". You have beaten your opponent.<br/>Well Played", 2);
		} else {
			if (currentPlayer==1) { newPlayer = 2; } else { newPlayer = 1; }
			$(".diceheader").html("Player " + newPlayer.toString() + " throw the dice");
			popup("Player " + newPlayer, "Please throw the dice", 0);
			setTimeout( function() {
				$("#variables").data({ "hasdicebeenrolled": 0, "currentplayer": newPlayer });
			}, 2000);
		}			
	}
	
	$("#" + idname).css("z-index", 1);
	if (wincounter!=7) {
		$(".dice").addClass("clickable"); // MAKE THE DICE CLICKABLE AGAIN
		$(".position").css("opacity",1); // AND MAKE SURE ALL POSITIONS ARE AT FULL OPACITY
		console.log("------------- END OF TURN -------------");
	} else {
		console.log("************* END OF GAME *************");
	}
}